package com.sajansthapit.authserver.config.bootstrap.dto;import java.util.List;public class BootstrapSettingDto {    private BootstrapUserDto user;    private List<String> roles;    private BootstrapClientDto client;    private BootstrapDefaultClientDto defaultClient;    public BootstrapSettingDto() {    }    public BootstrapSettingDto(BootstrapUserDto user, List<String> roles, BootstrapClientDto client, BootstrapDefaultClientDto defaultClient) {        this.user = user;        this.roles = roles;        this.client = client;        this.defaultClient = defaultClient;    }    public BootstrapUserDto getUser() {        return user;    }    public void setUser(BootstrapUserDto user) {        this.user = user;    }    public List<String> getRoles() {        return roles;    }    public void setRoles(List<String> roles) {        this.roles = roles;    }    public BootstrapClientDto getClient() {        return client;    }    public void setClient(BootstrapClientDto client) {        this.client = client;    }    public BootstrapDefaultClientDto getDefaultClient() {        return defaultClient;    }    public void setDefaultClient(BootstrapDefaultClientDto defaultClient) {        this.defaultClient = defaultClient;    }}